import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <h2>Employee List</h2>
      <ul>
        {employees.map(emp => (
            <li key={emp.employeeId}>{emp.employeeName}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
